import React from 'react'
import MenuItems from './MenuItems.js'


const Navbar = () => {
    return(
        <div>
            <nav>
                <ul>
                    {MenuItems.map((item) => {return <li>{item.title}</li>;})}
                </ul>
            </nav>
        </div>
    );
};

export default Navbar;
